import fixed from './fixed';

function totalPrice(tasks) {
  let price = 0;

  // eslint-disable-next-line no-restricted-syntax
  for (const task of tasks) {
    price += task.coinTotalPrice;
  }
  console.log(price);
  return fixed(price);
}

export default totalPrice;
